  [],\n\t\"num_tags\": 0,\n\t\"name\": \"current-direction-bathythermograph-xbt-ctd-and-other-data-from-moored-current-meter-casts-and-o2c103\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Current direction, bathythermograph (xbt),
  CTD, and other data were collected using moored current meter casts and other instruments
  in the Coastal Waters of California from March 9, 1987 to November 1, 1989. Data
  were submitted by Edgerton, Germeshausen and Grier, INC. as part of the North California
  Coastal Circulation Study (NCCCS) project. Data has been been processed by NODC
  to the NODC standard F015- Current Meter Data, F022- CTD High Resolution, and C116-
  Bathythermograph XBT formats. Full format descriptions are available from NODC homepage
  at http://www.noaa.nodc.gov.nnThe F015 format is used for time series measurements
  of ocean currents. These data are obtained from current meter moorings and represent
  Eulerian method of current measurement, i.e., the meters are deployed at a fixed
  point and measure flow past a sensor. Position, bottom depth, sensor depth, and
  meter characteristics are reported for each station. The data record comprises values
  of east-west (u) and north-south (v) current vector components at specified date
  and time. Current direction is defined as the direction toward which the water is
  flowing with positive directions east and north and negative directions west and
  south. Data values may be subject to averaging or filtering and are typically reported
  at 10-15 minute time intervals. Water temperature, pressure, and conductivity or
  salinity may also be reported. A text record is available for optional comments.nnThe
  F022 format contains high-resolution data collected using CTD (conductivity-temperature-depth)
  and STD (salinity-temperature-depth) instruments. As they are lowered and raised
  in the oceans, these electronic devices provide nearly continuous profiles of temperature,
  salinity, and other parameters. Data values may be subject to averaging or filtering
  or obtained by interpolation and may be reported at depth intervals as fine as 1m.
  Cruise and instrument information, position, date, time and sampling interval are
  reported for each station. Environmental data at the time of the cast (meteorological
  and sea surface conditions) may also be reported. The data record comprises values
  of temperature, salinity or conductivity, density (computed sigma-t), and possibly
  dissolved oxygen or transmissivity at specified depth or pressure levels. Data may
  be reported at either equally or unequally spaced depth or pressure intervals. A
  text record is available for comments.nnThe C116 format contains temperature-depth
  profile data obtained using expendable bathythermograph (XBT) instruments. Cruise
  information, position, date and time were reported for each observation. The data
  record was comprised of pairs of temperature-depth values. Unlike the MBT Data File,
  in which temperature values were recorded at uniform 5 m intervals, the XBT data
  files contained temperature values at non-uniform depths. These depths were recorded
  at the minimum number of points (\"inflection points\") required to accurately define
  the temperature curve. Standard XBTs can obtain profiles to depths of either 450
  or 760 m. With special instruments, measurements can be obtained to 1830 m. Prior
  to July 1994, XBT data were routinely processed to one of these standard types.
  XBT data are now processed and loaded directly in to the NODC Ocean Profile Data
  Base (OPDB). Historic data from these two data types were loaded into the OPDB.\",\n\t\"owner_org\":
